import React, {useState} from 'react'

import Messages from './component/Messages';
import Form from './component/Forms';

interface Input {
  id:string; 
  namez: string; 
}


const App: React.FC = () => {
  const [init, setAfter] = useState<Input[]>([]);

  // const input = [{id:" a1", text: "name"}]

  const inputHandler = (input: string)=> {
      console.log(input); 
      setAfter(prevInput => [...prevInput, {id:Math.random().toString(), 
        namez: input}])
  }

  return (
    <div>
      <h2>Let's get started with Ts and some more items </h2>
      <Messages items={init}/> 
      <Form onCalling={inputHandler}/> 
    </div>
  );
}

export default App;
